import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { Form, Button, Modal } from 'react-bootstrap';

function Register() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState('student');
  const [name, setName] = useState('');
  const [studentId, setStudentId] = useState('');
  const [branch, setBranch] = useState('');
  const [section, setSection] = useState('');
  const [subject, setSubject] = useState('');
  const [showRegisterPopup, setShowRegisterPopup] = useState(false);
  const [registerMessage, setRegisterMessage] = useState('');
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/api/register', {
        email,
        password,
        role,
        name,
        ...(role === 'student' && { studentId, branch, section }),
        ...(role === 'faculty' && { subject })
      }, {
        headers: { 'Content-Type': 'application/json' }
      });
      setRegisterMessage(response.data.msg);
      setShowRegisterPopup(true);
      setTimeout(() => {
        setShowRegisterPopup(false);
        navigate('/');
      }, 2000); // Redirect after 2 seconds
    } catch (err) {
      console.error('Registration error:', err);
      setRegisterMessage(err.response?.data?.msg || 'Registration failed');
      setShowRegisterPopup(true);
    }
  };

  return (
    <div className="dashboard-content">
      <h2>Register</h2>
      <Form onSubmit={handleSubmit}>
        <Form.Group className="form-group">
          <Form.Label>Name</Form.Label>
          <Form.Control
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter name"
            required
          />
        </Form.Group>
        <Form.Group className="form-group">
          <Form.Label>Email</Form.Label>
          <Form.Control
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="Enter email"
            required
          />
        </Form.Group>
        <Form.Group className="form-group">
          <Form.Label>Password</Form.Label>
          <Form.Control
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="Enter password"
            required
          />
        </Form.Group>
        <Form.Group className="form-group">
          <Form.Label>Role</Form.Label>
          <Form.Select value={role} onChange={(e) => setRole(e.target.value)}>
            <option value="student">Student</option>
            <option value="faculty">Faculty</option>
          </Form.Select>
        </Form.Group>
        {role === 'student' && (
          <>
            <Form.Group className="form-group">
              <Form.Label>Student ID</Form.Label>
              <Form.Control
                type="text"
                value={studentId}
                onChange={(e) => setStudentId(e.target.value)}
                placeholder="Enter student ID (e.g., 24MC10250)"
                required
              />
            </Form.Group>
            <Form.Group className="form-group">
              <Form.Label>Branch</Form.Label>
              <Form.Control
                type="text"
                value={branch}
                onChange={(e) => setBranch(e.target.value)}
                placeholder="Enter branch (e.g., CSE)"
                required
              />
            </Form.Group>
            <Form.Group className="form-group">
              <Form.Label>Section</Form.Label>
              <Form.Control
                type="text"
                value={section}
                onChange={(e) => setSection(e.target.value)}
                placeholder="Enter section (e.g., A)"
                required
              />
            </Form.Group>
          </>
        )}
        {role === 'faculty' && (
          <Form.Group className="form-group">
            <Form.Label>Subject</Form.Label>
            <Form.Control
              type="text"
              value={subject}
              onChange={(e) => setSubject(e.target.value)}
              placeholder="Enter subject (e.g., Programming)"
              required
            />
          </Form.Group>
        )}
        <Button className="btn-danger" type="submit">
          Register
        </Button>
      </Form>
      <Modal show={showRegisterPopup} onHide={() => setShowRegisterPopup(false)}>
        <Modal.Header closeButton>
          <Modal.Title>{registerMessage.includes('successfully') ? 'Success' : 'Error'}</Modal.Title>
        </Modal.Header>
        <Modal.Body>{registerMessage}</Modal.Body>
        <Modal.Footer>
          <Button variant={registerMessage.includes('successfully') ? 'primary' : 'secondary'} onClick={() => setShowRegisterPopup(false)}>
            Close
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default Register;
